(function () {
  var provEle = document.getElementById('allPro');
  var cityEle = document.getElementById('allCity');
  var cacheAreaAll = [];
  
  dealareaList(areaList); // 处理全部地区数据

  provEle.innerHTML = '<option value="">请选择</option>';
  cityEle.innerHTML = '<option value="">请选择</option>';
  initProv();

  // prov change
  provEle.addEventListener('change', function(){
    cityEle.innerHTML = '<option value="">请选择</option>';
    var selectedProvId = this.value;
    selectedProvId && initCity(selectedProvId);
  },true);

  // 处理全部地区数据
  /*
  cacheAreaAll = [{
    id: '',
    name: '',
    parentId: '',
    sub: [{
      id: '',
      name: '',
      parentId: '',
      sub: []
    }]
  }]
  */
  function dealareaList(areaList){
    var i = 0,
        l = areaList.length;
    for(;i<l;i+=1){
      var data = {
          id: areaList[i].id,
          name: areaList[i].name,
          parentId: areaList[i].parentId,
          sub: []
      };
      if(data.parentId == '-1'){
          cacheAreaAll.push(data)
      }else{
          addDataToCacheAreaDealer(data,cacheAreaAll);
      }
    }
  }

  // 递归
  function addDataToCacheAreaDealer(data,arr){
    arr.forEach(function(item,index,a){
      if(item.id===data.parentId){
        a[index]['sub'].push(data)
      }else{
        a[index]['sub']&&addDataToCacheAreaDealer(data,a[index]['sub'])
      }
    })
  }


  function initProv(){
    var opStr = '<option value="">请选择</option>';
    cacheAreaAll.forEach(function(item,index,arr){
      opStr += '<option value="'+item.id+'">'+item.name+'</option>';
    });
    provEle.innerHTML = opStr;
  }

  function initCity(proId){
    var opStr = '<option value="">请选择</option>';
    cacheAreaAll.some(function(item,index,arr){
      if(item.id==proId){
        arr[index]['sub'].forEach(function(cItem){
          opStr += '<option value="'+cItem.id+'">'+cItem.name+'</option>';
        })
        return true;
      }
    });
    cityEle.innerHTML = opStr;
  }

})()

